(119, 4, '๑. อ่านออกเสียงคำ สะกดคำ อ่านกลุ่มคำ ประโยค และบทพูดเข้าจังหวะ (chant) ง่ายๆ ถูกต้อง       ตามหลักการอ่าน\n๒.เลือก/ระบุภาพ หรือสัญลักษณ์ตรงตามความหมายของกลุ่มคำและประโยคที่ฟัง\n๓.ตอบคำถามจากการฟังหรืออ่านประโยค  บทสนทนา หรือนิทานง่ายๆ\n๔. พูดโต้ตอบด้วยคำสั้นๆ ง่ายๆ ในการสื่อสารระหว่างบุคคลตามแบบที่ฟัง\n๕. ใช้คำสั่งและคำขอร้องง่ายๆ ตามแบบที่ฟัง\n', 30, 'e13101', 'อ13101', 2, 1, 0, 0, 0, 0, 0, 5, 0, 0, 0, 0, 0, 5, 10, 1, 0, 0, 0, 0, 0, 5, 0, 0, 0, 0, 0, 5, 10),
(120, 5, '๖.  บอกความต้องการง่ายๆ ของตนเองตามแบบที่ฟัง\n๗. พูดขอและให้ข้อมูลง่ายๆ เกี่ยวกับตนเอง และเพื่อนตามแบบที่ฟัง\n๘. บอกความรู้สึกของตนเองเกี่ยวกับสิ่งต่างๆ ใกล้ตัว หรือกิจกรรมต่างๆ ตามแบบที่ฟัง\n๙. พูดให้ข้อมูลเกี่ยวกับตนเองและเรื่องใกล้ตัว\n๑๐.จัดหมวดหมู่คำตามประเภทของบุคคล สัตว์ และสิ่งของ ตามที่ฟัง หรืออ่าน\n๑๑. พูดและทำท่าประกอบ ตามมารยาทสังคม/วัฒนธรรมของเจ้าของภาษา \n๑๒.  บอกชื่อและคำศัพท์ง่ายๆ เกี่ยวกับเทศกาล/วันสำคัญ/งานฉลอง และชีวิตความเป็นอยู่ของ            เจ้าของภาษา\n', 30, 'e13101', 'อ13101', 2, 0, 0, 1, 0, 0, 0, 0, 0, 5, 0, 0, 0, 5, 10, 1, 0, 0, 0, 0, 0, 5, 0, 0, 0, 0, 0, 5, 10),
(121, 6, '๑๓.  เข้าร่วมกิจกรรมทางภาษาและวัฒนธรรมที่เหมาะกับวัย  \n ๑๔.   บอกความแตกต่างของเสียงตัวอักษร คำ กลุ่มคำ และประโยคง่ายๆ ของภาษาต่างประเทศ  และ ภาษาไทย\n ๑๕. บอกคำศัพท์ที่เกี่ยวข้องกับกลุ่มสาระการเรียนรู้อื่น\n ๑๖. ฟัง/พูดในสถานการณ์ง่ายๆ ที่เกิดขึ้นในห้องเรียน\n  ๑๗.   ใช้ภาษาต่างประเทศ เพื่อรวบรวมคำศัพท์ที่เกี่ยวข้องใกล้ตัว\n\n', 40, 'e13101', 'อ13101', 2, 0, 0, 0, 1, 1, 0, 0, 0, 0, 5, 5, 0, 10, 10, 1, 0, 1, 0, 0, 0, 5, 0, 5, 0, 0, 0, 10, 10),
