(131, 4, '๑.	อ่านออกเสียงประโยค ข้อความ  และบทกลอนสั้นๆ ถูกต้องตามหลักการอ่าน\n๒.	ระบุ/วาดภาพ สัญลักษณ์ หรือเครื่องหมายตรงตามความหมายของประโยคและข้อความสั้นๆ ที่ฟัง หรืออ่าน\n๓.	บอกใจความสำคัญ  และตอบคำถามจากการฟังและอ่านบทสนทนา และนิทานง่ายๆ หรือ    เรื่องสั้นๆ\n๔.	ใช้คำสั่ง  คำขอร้อง  คำขออนุญาต และให้คำแนะนำง่ายๆ\n๕.	พูด/เขียนแสดงความต้องการ  ขอความช่วยเหลือ ตอบรับและปฏิเสธการให้ความช่วยเหลือในสถานการณ์ง่ายๆ\n๖.	พูด/เขียนเพื่อขอและให้ข้อมูลเกี่ยวกับตนเอง เพื่อน ครอบครัว และเรื่องใกล้ตัว \n', 30, 'e15101', 'อ15101', 2, 1, 0, 0, 0, 0, 0, 5, 0, 0, 0, 0, 0, 5, 10, 0, 0, 1, 0, 0, 0, 0, 0, 5, 0, 0, 0, 5, 10),
(132, 5, '๗.	พูด/เขียนแสดงความรู้สึกของตนเองเกี่ยวกับเรื่องต่างๆ ใกล้ตัว และกิจกรรมต่างๆ พร้อมทั้งให้เหตุผลสั้นๆ ประกอบ\n๘.	  พูด/เขียนให้ข้อมูลเกี่ยวกับตนเองและเรื่องใกล้ตัว\n๙.	 พูด/เขียนแสดงความรู้สึกของตนเองเกี่ยวกับเรื่องต่างๆ ใกล้ตัว และกิจกรรมต่างๆ พร้อมทั้งให้เหตุผลสั้นๆ ประกอบ\n๑๐.	เขียนภาพ แผนผัง  และแผนภูมิแสดงข้อมูลต่างๆ ตามที่ฟังหรืออ่าน\n๑๑.	พูดแสดงความคิดเห็นเกี่ยวกับเรื่องต่างๆ ใกล้ตัว\n   ๑๒. ใช้ถ้อยคำ น้ำเสียง และกิริยาท่าทางอย่างสุภาพ ตามมารยาทสังคมและวัฒนธรรมเจ้าของ \n             ภาษา \n', 30, 'e15101', 'อ15101', 2, 0, 1, 0, 0, 0, 0, 0, 5, 0, 0, 0, 0, 5, 10, 0, 0, 0, 1, 0, 0, 0, 0, 0, 5, 0, 0, 5, 10),
(133, 6, '๑๓.	ตอบคำถาม/บอกความสำคัญของเทศกาล/วันสำคัญ/งานฉลองและชีวิตความเป็นอยู่ง่ายๆ  ของเจ้าของภาษา  \n๑๔.	 เข้าร่วมกิจกรรมทางภาษาและวัฒนธรรมตามความสนใจ\n๑๕.	 บอกความเหมือน/ความแตกต่างระหว่างการออกเสียงประโยคชนิดต่างๆ  การใช้เครื่องหมาย\nวรรคตอน  และการลำดับคำ (order) ตามโครงสร้างประโยค ของภาษาต่างประเทศและภาษาไทย\n๑๖.	บอกความเหมือน/ความแตกต่างระหว่างเทศกาลและงานฉลอง ของเจ้าของภาษากับของไทย\n๑๗.	 ค้นคว้า รวบรวมคำศัพท์ที่เกี่ยวข้องกับกลุ่มสาระการเรียนรู้อื่น และนำเสนอด้วยการพูด / การเขียน\n๑๘.	ฟัง พูด และอ่าน/เขียนในสถานการณ์ต่างๆ ที่เกิดขึ้นในห้องเรียนและสถานศึกษา\n๑๙.	ใช้ภาษาต่างประเทศในการสืบค้นและรวบรวมข้อมูลต่างๆ\n', 40, 'e15101', 'อ15101', 2, 0, 0, 0, 1, 0, 1, 0, 0, 0, 5, 0, 5, 10, 10, 0, 1, 0, 0, 0, 1, 0, 5, 0, 0, 0, 5, 10, 10),
